import * as React from 'react';
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import Button from '@mui/material/Button';
import List from '@mui/material/List';
import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import InboxIcon from '@mui/icons-material/MoveToInbox';
import MailIcon from '@mui/icons-material/Mail';
import BookFlight from './pages/CreateFlight';
import MenuIcon from "@mui/icons-material/Menu";


  function Gootoo(index){
    if(index==0)
    {
      return '/createflight/'
    }
    else if(index==1)
    {
      return '/getusers'
    }
    else if(index==2)
    {
      return '/login'
    }
    else if(index==3)
    {
      return '/sign'
    }

  }

  export default function Drawee() {
    const [open, setOpen] = React.useState(false);
    const toggleDrawer = (newOpen) => () => {
      setOpen(newOpen);
    };
  
    const DrawerList = (
      <Box sx={{ width: 250 }} role="presentation" onClick={toggleDrawer(false)}>
        <List>
          {['Create a Flight', 'View users', 'Log in as Admin', 'Log in as Airline'].map((text, index) => (
            <a href={Gootoo(index)}>
            <ListItem key={text} disablePadding onClick={Gootoo(index)}>
              <ListItemButton>
                <ListItemIcon>
                  {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
                </ListItemIcon>
                <ListItemText primary={text} />
              </ListItemButton>
            </ListItem>
            </a>
          ))}
        </List>
        <Divider />
        <List>
          {['All mail', 'Trash', 'Spam'].map((text, index) => (
            <ListItem key={text} disablePadding>
              <ListItemButton>
                <ListItemIcon>
                  {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
                </ListItemIcon>
                <ListItemText primary={text} />
              </ListItemButton>
            </ListItem>
          ))}
        </List>
      </Box>
    );
  
    return (
      <div style={{position:'relative',top:'0',left:'0', scale:'1.7'}}>
        <Button onClick={toggleDrawer(true)} style={{backgroundColor:'lightblue'}}><MenuIcon/></Button>
        <Drawer open={open} onClose={toggleDrawer(false)}>
          {DrawerList}
        </Drawer>
      </div>
    );
  }
